CREATE PROCEDURE dbo.proc_transform_134
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_134
    SET payload = LEFT(payload, 1000) + N'|V4-134|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_134;
END
